import React, { Component } from "react";
import Axios from "axios";
import "./law_report.css";
import ReactTable from "react-table-6";

class law_report extends Component {
  constructor(props) {
    super(props);
    this.state = {
      lawyers: "hi",
    };
  }
  componentDidMount = () => {
    const url = "/lawyersReporter";
    Axios.get(url).then((response) => {
      //console.log(response.data.tem_c);
      this.setState({ tableData: response.data.tableData });
      console.log(response.data);
    });
  };

  render() {
    return <div className="topic">LIST OF LAWYERS</div>;
  }
}

export default law_report;
